import React from 'react';
import styles from "./Edu.module.css";
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Grid, Card, CardActionArea, CardActions, CardContent, CardMedia, CardHeader, Box} from '@material-ui/core';
import utsa from './utsa.png';
import cx from 'classnames';


const useStyles = makeStyles({
    root: {
      maxWidth: 345
    },
  });


function Edu() {
    const classes = useStyles();
    return (
        <div>
            <Box m={0}>
                <Card className={cx(styles.header, styles.all)}>
                    <Typography variant="h5" className={cx(styles.text, styles.ty)}>Education</Typography> 
                    <CardActionArea>
                        <CardMedia
                        component="img"
                        alt="UTSA"
                        height="100"
                        image={utsa}
                        title="UTSA"
                        className={styles.img}
                        />
                        <CardContent>
                            <Typography gutterBottom component="h4" className={styles.subs}>
                            Bachelor's of Science in Computer Science  2017-2020
                            </Typography>
                            <Typography variant="body2" color="textSecondary" component="p">

                            </Typography>
                        </CardContent>
                    </CardActionArea>
                </Card>
            </Box>
        </div>
    );
}

export default Edu;
